import React, { Component } from "react";
import { Link } from "react-router-dom";
import "./blog.css";
export default class Blog extends Component {
  constructor(props){
    super(props)
  }
  render() {
    return (
      <div className="blog">
        <div className="blog-main-box">
            
            <center>
                <img src={require(this.props.image)} alt="N?a" />
            </center>
            <header>
                <Link className="Link"> {this.props.heading}   </Link>          
            </header>
            <footer>
                <p>
                {this.props.peragraph}
                </p>
            </footer>
        </div>
      </div>
    );
  }
}
